const JokesData = [
    {
        id: 1,
        punchLine: "Nothing here to see"
    },
    {
        id: 2,
        question: "How are you ?",
        punchLine: "Not much"
    },
    {
        id: 3,
        question: "What up ?",
        punchLine: "Yeye!"
    }
]

export default JokesData;
